        private static Skill CreateSkill(int currentLevel, int level, int addXp = 0)
        {
            return new()
            {
                Level = level,
                CurrentLevel = currentLevel,
                Xp = LevelTable.GetXp(level) + addXp
            };
        }

        private static IList<TAccountItem> CreateItems<TAccountItem>(int max, bool skipOne = false) where TAccountItem : AccountItem, new()
        {
            var list = new List<TAccountItem>();
            int pos;
            int id;
            for (pos = 0, id = 0; pos < max;)
            {
                list.Add(new TAccountItem
                {
                    Count = id + 1,
                    ItemDefinitionId = id,
                    Position = pos
                });

                id = 1 + id;
                pos = (skipOne ? 2 : 1) + pos;
            }

            return list;
        }
